{
  "name": "UBX-NAV-TIMEBDS",
  "class_id": "0x01",
  "message_id": "0x24",
  "message_type": "periodic_polled",
  "description": "This message reports the precise BDS time of the most recent navigation solution including validity flags and an accuracy estimate.",
  "payload_length": {
    "fixed": 20
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
    },
    {
      "byte_offset": 4,
      "data_type": "U4",
      "name": "SOW",
      "unit": "S",
      "description": "BDS time of week (rounded to seconds)"
    },
    {
      "byte_offset": 8,
      "data_type": "I4",
      "name": "fSOW",
      "unit": "ns",
      "description": "Fractional part of SOW (range: +/-500000000). The precise BDS time of week in seconds is: SOW + fSOW * 1e-9"
    },
    {
      "byte_offset": 12,
      "data_type": "I2",
      "name": "week",
      "description": "BDS week number of the navigation epoch"
    },
    {
      "byte_offset": 14,
      "data_type": "I1",
      "name": "leaps",
      "unit": "S",
      "description": "BDS leap seconds (BDS-UTC)"
    },
    {
      "byte_offset": 15,
      "data_type": "X1",
      "name": "valid",
      "description": "Validity Flags"
    },
    {
      "byte_offset": 16,
      "data_type": "U4",
      "name": "tAcc",
      "unit": "ns",
      "description": "Time Accuracy Estimate"
    }
  ]
}
